	public String generatePDF(Map<String, String> details, List<ConsultMedicationDtlsDTO> medicineDetails)
			throws IOException {

		PdfWriter writer = null;
		PdfDocument pdfDoc = null;
		Document document = null;

		try {
			String path = prescriptionPath + pathSeperator;
			String filePath = path + details.get(ConsultationConstants.APPTID.getValue()) + ".pdf";
			generateDirectory(path);
			Files.deleteIfExists(Paths.get(filePath));

			writer = new PdfWriter(filePath);
			pdfDoc = new PdfDocument(writer);
			document = new Document(pdfDoc);

			Paragraph para;
			
			// Clinic name
//			Paragraph para = new Paragraph("NSDL Telemedicine Clinic");
//			para.setSpacingRatio(12);
//			para.setFontSize(38);
//			// para.setUnderline(1, -2);
//			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
//			para.setBold();
//			para.setMarginBottom(-5);
//			document.add(para);
//
//			// Clinic Address
//			para = new Paragraph("Times Tower, Parel, Mumbai 400013");
//			// para.setVerticalAlignment(VerticalAlignment.TOP);
//			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
//			para.setFontSize(8);
//			para.setMarginTop(-7);
//			document.add(para);

			// Doctor Name
			para = new Paragraph("Dr. " + details.get(ConsultationConstants.DRNAME.getValue()).toUpperCase());
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(30);
			para.setMarginBottom(-5);
			document.add(para);

			// Doctor Specialization
			para = new Paragraph(details.get(ConsultationConstants.DRSPECIALIZATION.getValue()) + " | SMC no. "
					+ details.get(ConsultationConstants.DRSMCNO.getValue()));
			// para.setVerticalAlignment(VerticalAlignment.TOP);
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(8);
			para.setMarginTop(-7);
			para.setMarginBottom(1);
			document.add(para);

			// Line Seperator
			document.add(new LineSeparator(new SolidLine(2f)));

			// Date
			para = new Paragraph(ConsultationConstants.APPTDATE.getValue() + " : "
					+ details.get(ConsultationConstants.APPTDATE.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.COURIER_BOLD));
			para.setMarginTop(2);
			para.setFontSize(10f);
			para.setBold();
			para.setMarginLeft(410F);
			// para.add(new Tab());
			// para.addTabStops(new TabStop(1000, TabAlignment.RIGHT));
			document.add(para);

			// Patient name and gender
			para = new Paragraph(ConsultationConstants.PTNAME.getValue() + ": "
					+ details.get(ConsultationConstants.PTNAME.getValue()) + " ("
					+ details.get(ConsultationConstants.GENDER.getValue()) + ")");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(16f);
			para.setMarginTop(3);
			// para.setMarginBottom(-2);
			document.add(para);

			// AppointmentId And Age
			para = new Paragraph(ConsultationConstants.APPTID.getValue() + ": "
					+ details.get(ConsultationConstants.APPTID.getValue()) + ", " + ConsultationConstants.AGE.getValue()
					+ ": " + details.get(ConsultationConstants.AGE.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Address
			para = new Paragraph("Address: " + details.get(ConsultationConstants.PTADDRESS.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Chief Complain Heading
			para = new Paragraph(ConsultationConstants.CHIEFCOMPLAINTS.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(6);
			document.add(para);
			// Chief Complain Details
			para = new Paragraph(details.get(ConsultationConstants.CHIEFCOMPLAINTS.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Diagnosis Heading
			para = new Paragraph(ConsultationConstants.DIAGNOSIS.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(6);
			document.add(para);
			// Diagnosis Details
			para = new Paragraph(details.get(ConsultationConstants.DIAGNOSIS.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Investigation Heading
			para = new Paragraph(ConsultationConstants.INVESTIGATION.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(6);
			document.add(para);
			// Investigation Details
			para = new Paragraph(details.get(ConsultationConstants.INVESTIGATION.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			para.setMarginBottom(5);
			document.add(para);

			// Medicine Details
			Table table = new Table(new float[3]).useAllAvailableWidth();
			table.setMarginTop(10);
			Cell cell = new Cell().add(new Paragraph("Medicine Names").setBold()
					.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN)));
			cell.setTextAlignment(TextAlignment.LEFT);
			// cell.setPadding(5);
			cell.setBorder(Border.NO_BORDER);
			cell.setBorderTop(new SolidBorder(1));
			cell.setBorderBottom(new SolidBorder(1));
			table.addHeaderCell(cell);

			cell = new Cell()
					.add(new Paragraph("Type").setBold().setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN)));
			cell.setTextAlignment(TextAlignment.LEFT);
			// cell.setPadding(5);
			cell.setBorder(Border.NO_BORDER);
			cell.setBorderTop(new SolidBorder(1));
			cell.setBorderBottom(new SolidBorder(1));
			table.addHeaderCell(cell);

			cell = new Cell()
					.add(new Paragraph("Unit").setBold().setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN)));
			cell.setTextAlignment(TextAlignment.LEFT);
			// cell.setPadding(5);
			cell.setBorder(Border.NO_BORDER);
			cell.setBorderBottom(new SolidBorder(1));
			cell.setBorderTop(new SolidBorder(1));
			table.addHeaderCell(cell);

			for (ConsultMedicationDtlsDTO medication : medicineDetails) {

				para = new Paragraph();
				Text t1 = new Text(medication.getCmdMedicineName());
				t1.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
				t1.setFontSize(12F);
				para.add(t1);

				Text t2 = new Text("\n(" + medication.getCmdMedicineDoseDtls() + ")");
				t2.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
				t2.setFontSize(8F);
				para.add(t2);
				para.setSpacingRatio(1F);

				cell = new Cell().add(para);
				cell.setBorder(Border.NO_BORDER);
				table.addCell(cell);

				cell = new Cell().add(new Paragraph(medication.getCmdMedicineType())
						.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN)).setFontSize(12F));
				cell.setFontSize(12F);
				cell.setBorder(Border.NO_BORDER);
				table.addCell(cell);

				cell = new Cell().add(new Paragraph(medication.getCmdMedicineUnit())
						.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN)).setFontSize(12F));
				cell.setBorder(Border.NO_BORDER);
				table.addCell(cell);
			}

			table.setBorderBottom(new SolidBorder(1));
			document.add(table);
			// Medicine Details End

			// Advice Heading
			para = new Paragraph(ConsultationConstants.ADVICE.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(8);
			document.add(para);

			// Advice Details
			para = new Paragraph(details.get(ConsultationConstants.ADVICE.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			para.setMarginBottom(5);
			document.add(para);

			// Dr. confirmation
			para = new Paragraph();
			Text t1 = new Text(details.get(ConsultationConstants.DRNAME.getValue()));
			t1.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			t1.setFontSize(12F);
			Text t2 = new Text("\n(" + details.get(ConsultationConstants.DRSPECIALIZATION.getValue()) + ")");
			t2.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			t2.setFontSize(10F);
			t2.setHorizontalAlignment(HorizontalAlignment.CENTER);
			para.add(t1);
			para.add(t2);
			para.setMarginTop(15F);
			para.setMarginLeft(410F);
			para.setHorizontalAlignment(HorizontalAlignment.CENTER);

			document.add(para);
			document.close();
			pdfDoc.close();
			writer.close();
			return filePath;
		} catch (Exception e) {
			logger.error(e.getLocalizedMessage());
			throw new ConsultationServiceException(ErrorConstants.ERROR_GENERATING_PDF.getCode(),
					ErrorConstants.ERROR_GENERATING_PDF.getMessage());
		} finally {
			document.close();
			pdfDoc.close();
			writer.close();
		}
	}
	
