	/**
	 * @param details
	 * @return
	 * @throws IOException
	 * 
	 * Added by girishk to generate prescription pdf as per doctor provided template.
	 */
	public String generatePrescriptionPDFAsPerDoctorTemplate(Map<String, String> details, String templateImagePath)
			throws IOException {
		PdfWriter writer = null;
		PdfDocument pdfDoc = null;
		Document document = null;
		try {
			String path = prescriptionPath + pathSeperator;
			String filePath = path + details.get(ConsultationConstants.APPTID.getValue()) + ".pdf";
			generateDirectory(path);
			Files.deleteIfExists(Paths.get(filePath));
			File[] files = new File(templateImagePath).listFiles();

			writer = new PdfWriter(filePath);
			pdfDoc = new PdfDocument(writer);
			document = new Document(pdfDoc);

			Paragraph para;
			
			//Creating a header image.      
		    String templateHeader = templateImagePath + files[1].getName();       
		    ImageData headerData = ImageDataFactory.create(templateHeader);              
	        Image headerImage = new Image(headerData);                        
	        headerImage.setFixedPosition(1, 750);
	        headerImage.setAutoScale(true);
	        document.add(headerImage);
		      
			// Date
			para = new Paragraph(ConsultationConstants.APPTDATE.getValue() + " : "
					+ details.get(ConsultationConstants.APPTDATE.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.COURIER_BOLD));
			para.setMarginTop(70);
			para.setFontSize(10f);
			para.setBold();
			para.setMarginLeft(410F);
			document.add(para);

			// Patient name and gender
			para = new Paragraph(ConsultationConstants.PTNAME.getValue() + ": "
					+ details.get(ConsultationConstants.PTNAME.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
//			para.setBold();
			para.setFontSize(16f);
			para.setMarginTop(3);
			// para.setMarginBottom(-2);
			document.add(para);

			// AppointmentId 
			para = new Paragraph(ConsultationConstants.APPTID.getValue() + ": "
					+ details.get(ConsultationConstants.APPTID.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);
			
			//Age
			para = new Paragraph(ConsultationConstants.AGE.getValue()
					+ ": " + details.get(ConsultationConstants.AGE.getValue()));
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Chief Complain Heading
			para = new Paragraph(ConsultationConstants.CHIEFCOMPLAINTS.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(6);
			document.add(para);
			// Chief Complain Details
			para = new Paragraph(null != details.get(ConsultationConstants.CHIEFCOMPLAINTS.getValue()) ? details.get(ConsultationConstants.CHIEFCOMPLAINTS.getValue()) : "");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Diagnosis Heading
			para = new Paragraph(ConsultationConstants.DIAGNOSIS.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(6);
			document.add(para);
			// Diagnosis Details
			para = new Paragraph(null != details.get(ConsultationConstants.DIAGNOSIS.getValue()) ? details.get(ConsultationConstants.DIAGNOSIS.getValue()) : "");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			document.add(para);

			// Medicine Heading
			para = new Paragraph(ConsultationConstants.MEDICATION.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(8);
			document.add(para);
			
			// Medicine Details
			para = new Paragraph(null != details.get(ConsultationConstants.MEDICATION.getValue()) ? details.get(ConsultationConstants.MEDICATION.getValue()).replace(":", " ") : "");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			para.setMarginBottom(5);
			document.add(para);
			// Medicine Details End

			// Advice Heading
			para = new Paragraph(ConsultationConstants.ADVICE.getValue() + " :");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setBold();
			para.setFontSize(14f);
			para.setMarginTop(8);
			document.add(para);

			// Advice Details
			para = new Paragraph(null != details.get(ConsultationConstants.ADVICE.getValue()) ? details.get(ConsultationConstants.ADVICE.getValue()) : "");
			para.setFont(PdfFontFactory.createFont(FontConstants.TIMES_ROMAN));
			para.setFontSize(12f);
			para.setMarginTop(-6);
			para.setMarginBottom(5);
			document.add(para);

			//Creating a footer image.      
		    String templateFooter = templateImagePath + files[0].getName();       
		    ImageData footerData = ImageDataFactory.create(templateFooter);              
	        Image footerImage = new Image(footerData);                        
	        footerImage.setFixedPosition(1, 50);
	        footerImage.setAutoScale(true);
	        document.add(footerImage);
			
			document.close();
			pdfDoc.close();
			writer.close();
			return filePath;
		} catch (Exception e) {
			logger.error(e.getLocalizedMessage());
			throw new ConsultationServiceException(ErrorConstants.ERROR_GENERATING_PDF.getCode(),
					ErrorConstants.ERROR_GENERATING_PDF.getMessage());
		} finally {
			document.close();
			pdfDoc.close();
			writer.close();
		}
	}
	
